pragma solidity ^0.4.24;

import "./ERC725.sol";
import "./ERC735.sol";

/** @title Self-sovereign identity. */
contract Identitat is ERC725, ERC735 {

    bytes32 public version = "0.1";

    event OwnershipChanged(address indexed newOwner);

    // WHEN WE TALK ABOUT BYTES32 WE TALK ABOUT CONVERTED ADDRESSES WITH KECCAK256
    mapping (bytes32 => Key) keysStruct;
    mapping (bytes32 => Claim) claims;
    mapping (uint256 => bytes32[]) keysByPurpose;
    mapping (uint256 => bytes32[]) keysByType;
    mapping (uint256 => bytes32[]) claimIdsByTopic;
    mapping (bytes32 => Transaction) txn;

    struct Transaction {
        address to;
        uint256 value;
        bytes data;
        bool approved;
        bool executed;
    }

    /** MUST only be done by keys of purpose 1, or the identity itself. 
     *  If its the identity itself, the approval process will determine its approval.
     */
    modifier managerOnly {
        require(keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == MANAGEMENT_KEY); //1
        _;
    }

    /** MUST only be done by keys of purpose 2, or the identity itself. 
     *  If its the identity itself, the approval process will determine its approval.
     */
    modifier actorOnly {
        require(keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == ACTION_KEY);
        _;
    }

    /** This SHOULD create a pending claim, which SHOULD to be approved or 
     *  rejected by n of m approve calls from keys of purpose 1.
     */
    modifier claimSignerOnly {
        require(keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == CLAIM_SIGNER_KEY);
        _;
    }

    modifier encryptionOnly {
        require(keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == ENCRYPTION_KEY);
        _;
    }

    /** @dev Constructor that create a MANAGEMENT_KEY to the contract deployer.
      */
    constructor () public {

        bytes32 _key = keccak256(abi.encodePacked(msg.sender));
        keysStruct[_key] = Key({
            purpose: 1,
            keyType: 1,
            key: _key
        });
        keysByPurpose[1].push(_key);
        keysByType[1].push(_key);

        emit KeyAdded(
            _key, 
            keysStruct[_key].purpose, 
            keysStruct[_key].keyType);
    }


    /** @dev Returns the key data, if hold by the identity.
      * @param _key keccack256 of original key.
      * @return purpose e.g., MANAGEMENT_KEY = 1, ACTION_KEY = 2, CLAIM_SIGNER_KEY = 3, ENCRYPTION_KEY = 4;
      * @return keyType e.g. 1 = ECDSA, 2 = RSA, etc.
      * @return key the key another time.
      */
    function getKey(
        bytes32 _key) 
        public view returns(uint256 purpose, uint256 keyType, bytes32 key) {

        return(
            keysStruct[_key].purpose, 
            keysStruct[_key].keyType, 
            keysStruct[_key].key);
    }

    /** @dev Returns the TRUE if a key has is present and has the given purpose. If key is not present it returns FALSE.
      * @param _key keccack256 of original key.
      * @param _purpose purpose to check.
      * @return exist True if exist, False if not.
      */
    function keyHasPurpose(
        bytes32 _key, 
        uint256 _purpose) 
        public view returns(bool exists) {

        if (keysStruct[_key].purpose == _purpose) {
            return true;
        }else {
            return false;
        }
    }

    /** @dev Returns an array of public key bytes32 hold by this identity.
      * @param _purpose purpose to check.
      * @return keys list of keys from one purpose.
      */
    function getKeysByPurpose(
        uint256 _purpose) 
        public view returns (bytes32[] keys) {

        return keysByPurpose[_purpose];
    }

    /** @dev Returns the key type of a key.
      * @param _key key to want to know the type.
      * @return keyType the type of the key.
      */
    function getKeyType(
        bytes32 _key) 
        public view returns(uint256 keyType) {

        return keysStruct[_key].keyType;
    }

    /** @dev Returns a list of keys with the same key type.
      * @param _keyType the keyType we want to check.
      * @return keys list of keys with the same _keyType.
      */
    function getKeysByType(
        uint256 _keyType) 
        public view returns(bytes32[] keys) {

        return keysByType[_keyType];
    }

    /** @dev Adds a _key to the identity. The _purpose specifies the purpose of key. Initially we propose four purposes
      * @dev 1: MANAGEMENT keys, which can manage the identity
      * @dev 2: ACTION keys, which perform actions in this identities name (signing, logins, transactions, etc.)
      * @dev 3: CLAIM signer keys, used to sign claims on other identities which need to be revokable.
      * @dev 4: ENCRYPTION keys, used to encrypt data e.g. hold in claims
      * @param _key the new key to want to create.
      * @return _purpose the purpose of the key
      * @return _keyType the type of encryptation of the key.
      * @return success true if the key succefully created or false if not.
      */
    function addKey(
        bytes32 _key, 
        uint256 _purpose, 
        uint256 _keyType) 
        public managerOnly returns (bool success) {

        require(keysStruct[_key].key != _key); // Key sould not exist

        //require(approve(uint256(_key), true)); // TODO es necesario aquí?

        keysStruct[_key] = Key( {
            purpose: _purpose,
            keyType: _keyType,
            key: _key
        });

        keysByPurpose[_purpose].push(_key);
        keysByType[_keyType].push(_key);

        emit KeyAdded(
            _key, 
            _purpose, 
            _keyType);

        return true;
    }

    /** @dev Removes _key from the identity.
      * @param _key key that want to delete.
      * @param _keyType key type of the key that want to delete.
      * @param _purpose purpose of the key that want to delete.
      * @return success true if succefully executed, false if not.
      */
    function removeKey(
        bytes32 _key, 
        uint256 _purpose, 
        uint256 _keyType) 
        public managerOnly returns (bool success) {

        require(keysStruct[_key].key == _key);

        delete keysStruct[_key];

        for(uint i = 0; i<keysByPurpose[_purpose].length; i++){
            if(keysByPurpose[_purpose][i] == _key)
                delete keysByPurpose[_purpose][i];
        }

        for(uint j = 0; j<keysByType[_keyType].length; i++){
            if(keysByType[_keyType][j] == _key)
                delete keysByPurpose[_keyType][j];
        }

        emit KeyRemoved(
            _key, 
            _purpose, 
            _keyType);

        return true;
    }

    /** @dev Executes an action on other contracts, or itself, or a transfer of ether.
      * @param _to x
      * @param _value x
      * @param _data x
      * @return executionId x
      */
    function execute(
        address _to, 
        uint256 _value, 
        bytes _data) 
        public returns (uint256 executionId) {

        //SHOULD require approve to be called with one or more keys of purpose 1 or 2 to approve this execution.
        require((keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == MANAGEMENT_KEY) || (keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == ACTION_KEY));

        executionId = uint256(keccak256(abi.encodePacked(_to, _value, _data)));

        //require(approve(executionId,true));
        emit ExecutionRequested(
            executionId,
            _to,
            _value, 
            _data);

        approve(executionId,true); //TODO always aprove?

        txn[bytes32(executionId)].to = _to;
        txn[bytes32(executionId)].value = _value;
        txn[bytes32(executionId)].data = _data;
        // txn[bytes32(executionId)].approved = ;
        // txn[bytes32(executionId)].executed = ;

        emit Executed(
            executionId, 
            _to, 
            _value, 
            _data);
        return executionId;
    }

    /** @dev Approves an execution or claim addition.
      * @param _id x
      * @param _approve x
      * @return success returns true if succefully executed the code, false if not
      */
    function approve(
        uint256 _id, 
        bool _approve) 
        public returns (bool success) {

        require((keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == MANAGEMENT_KEY) || (keysStruct[keccak256(abi.encodePacked(msg.sender))].purpose == ACTION_KEY));

        if (_approve) {
            emit Approved(_id, _approve);
            txn[bytes32(_id)].approved = true;
            success = txn[bytes32(_id)].to.call(txn[bytes32(_id)].data);

            if(success) {
                txn[bytes32(_id)].executed = true;
                uint256 executionId;
                executionId = uint256(keccak256(abi.encodePacked(txn[bytes32(_id)].to, txn[bytes32(_id)].value, txn[bytes32(_id)].data)));
                emit Executed(
                    executionId, 
                    txn[bytes32(_id)].to, 
                    txn[bytes32(_id)].value, 
                    txn[bytes32(_id)].data);
                return true;
            }

            else{
                //fail
                txn[bytes32(_id)].executed = false;
                return false;
            }

        }else {
            txn[bytes32(_id)].approved = false;
            return false;
        }

    }

    /** @dev Requests the ADDITION of a claim from an issuer.
      * @param _topic is the type of claim.
      * @param _scheme the estructure of the claim
      * @param _issuer from who comes the claim
      * @param _signature is a signed message of the following structure: keccak256(address subject_address, uint256 _topic, bytes _data).
      * @param _data data of the claim if exist
      * @param _uri link for more information of the claim
      * @return claimRequestId could be send to the approve function, to approve or reject this claim SUPER IMPORTANT
      */
    function addClaim(
        uint256 _topic, 
        uint256 _scheme, 
        address _issuer, 
        bytes _signature, 
        bytes _data, 
        string _uri) 
        public claimSignerOnly returns (bytes32 claimRequestId) {
        require(claims[claimId].topic == 0);
        bytes32 claimId = keccak256(abi.encodePacked(_issuer, _topic));

        claims[claimId] = Claim( {
            topic: _topic,
            scheme: _scheme,
            //_issuer = msg.sender,
            issuer: _issuer,
            //_signature = this.address+topic+data
            signature: _signature,
            data: _data,
            uri: _uri
        });

        claimIdsByTopic[_topic].push(claimId);
        emit ClaimAdded(
            claimId, 
            _topic, 
            _scheme, 
            _issuer, 
            _signature, 
            _data, 
            _uri);


        return claimId;
    }

    /** @dev Requests the CHANGE of a claim from an issuer.
      * @param _claimId id of the claim.
      * @param _topic is the type of claim.
      * @param _scheme the estructure of the claim
      * @param _issuer from who comes the claim
      * @param _signature is a signed message of the following structure: keccak256(address subject_address, uint256 _topic, bytes _data).
      * @param _data data of the claim if exist
      * @param _uri link for more information of the claim
      * @return success true if the claim change, false if
      */
    function changeClaim(
        bytes32 _claimId, 
        uint256 _topic, 
        uint256 _scheme, 
        address _issuer, 
        bytes _signature, 
        bytes _data, 
        string _uri) 
        public returns (bool success) {

        if (claims[_claimId].issuer > 0) { // exist and want to update
            //topic and issuer can't change
            //claims[claimId].topic = _topic;
            claims[_claimId].scheme = _scheme;
            //claims[claimId].issuer = _issuer;
            claims[_claimId].signature = _signature;
            claims[_claimId].data = _data;
            claims[_claimId].uri = _uri;

            emit ClaimChanged(
                _claimId, 
                _topic, 
                _scheme, 
                _issuer, 
                _signature, 
                _data, 
                _uri);
            return true;
        }else {
            return false;
        }
    }

    /** @dev Removes a claim. Can only be removed by the claim issuer, or the claim holder itself.
      * @param _claimId id of the claim.
      * @return success true if the claim change, false if
      */
    function removeClaim(
        bytes32 _claimId) 
        public returns (bool success) {

        require(msg.sender == claims[_claimId].issuer);
        emit ClaimRemoved(
            _claimId, 
            claims[_claimId].topic, 
            claims[_claimId].scheme, 
            claims[_claimId].issuer, 
            claims[_claimId].signature, 
            claims[_claimId].data, 
            claims[_claimId].uri);
        delete claims[_claimId];
        for(uint i = 0; i<claimIdsByTopic[claims[_claimId].topic].length; i++){
            if(claimIdsByTopic[claims[_claimId].topic][i] == _claimId)
                delete claimIdsByTopic[claims[_claimId].topic][i];
        }  

        return true;
    }

    /** @dev Returns a claim by ID.
      * @param _claimId id of the claim.
      * @param topic is the type of claim.
      * @param scheme the estructure of the claim
      * @param issuer from who comes the claim
      * @param signature is a signed message of the following structure: keccak256(address subject_address, uint256 _topic, bytes _data).
      * @param data data of the claim if exist
      * @param uri link for more information of the claim
      */
    function getClaim(
        bytes32 _claimId) 
        public view returns (
        uint256 topic, uint256 scheme, address issuer, bytes signature, bytes data, string uri) {

        return (
            claims[_claimId].topic, 
            claims[_claimId].scheme, 
            claims[_claimId].issuer, 
            claims[_claimId].signature, 
            claims[_claimId].data, 
            claims[_claimId].uri);
    }

    /** @dev Return a list of all claims with same topic
      * @param _topic topic we want to check
      * @return claimIds list of the claims with the same topic
      */
    function getClaimIdsByTopic(
        uint256 _topic) 
        public view returns(bytes32[] claimIds) {

        return claimIdsByTopic[_topic];
    }

    /** @dev Change the ownership (ManagerKey) of the contract to a new one
      * @param _newOwner the address of the new ownership
      * @return success true if the ownership address change
      */
    function transferOwnership(
        address _newOwner) 
        public managerOnly returns(bool success) {

        keysStruct[keccak256(abi.encodePacked(msg.sender))].key = keccak256(abi.encodePacked(_newOwner));
        emit OwnershipChanged(_newOwner);
        return true;
    }

    /** @dev Makes this contract payable.
      */
    function() public payable { }
}

